/* i really want this to be global */
.html5-scrubber-button, .ytp-scrubber-button {
    background: url("https://media.discordapp.net/attachments/982632918386102322/1109493328032055377/Untitled.png") !important;
    width: 765px !important;
    height: 60px !important;
    border: none !important;
    margin-left: -745px !important;
    margin-top: -56px !important;
}
.ytp-play-progress {
	background: linear-gradient(left ,#FEC9EF, #E5CCFF, #CCF5FF, #CEFFC4, #FFFCBF, #FFD5B9, #F7B4BA);
  background: -moz-linear-gradient(left ,#FEC9EF, #E5CCFF, #CCF5FF, #CEFFC4, #FFFCBF, #FFD5B9, #F7B4BA);
  	background: -o-linear-gradient(left ,#FEC9EF, #E5CCFF, #CCF5FF, #CEFFC4, #FFFCBF, #FFD5B9, #F7B4BA);
  	background: -webkit-linear-gradient(left ,#FEC9EF, #E5CCFF, #CCF5FF, #CEFFC4, #FFFCBF, #FFD5B9, #F7B4BA);
}
.ytp-unloaded-progress {
	background: linear-gradient(left ,#191919, #4d4d4d, #4C0000, #4c3200, #4c4c00, #002600, #00004c, #260026, #36264c, #4d4d4d, #191919);
  	background: -moz-linear-gradient(left ,#191919, #4d4d4d, #4C0000, #4c3200, #4c4c00, #002600, #00004c, #260026, #36264c, #4d4d4d, #191919);
  	background: -o-linear-gradient(left ,#191919, #4d4d4d, #4C0000, #4c3200, #4c4c00, #002600, #00004c, #260026, #36264c, #4d4d4d, #191919);
  	background: -webkit-linear-gradient(left ,#191919, #4d4d4d, #4C0000, #4c3200, #4c4c00, #002600, #00004c, #260026, #36264c, #4d4d4d, #191919);
}
.ytp-load-progress {
  background: rgba(90, 90, 90, .5);
}
